import React, { useState, useEffect } from "react";
import './App.css';
import { Router, Route, Switch } from "react-router-dom";

// Components

// Pages
import HomePage from "./pages/home/home.page.jsx";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
      </Switch>
    </Router>
  );
};

export default App;
